import React, { PureComponent } from 'react';
import Navbar from './Navbar';

export default class Layout extends PureComponent {
    render() {
        const { children, router } = this.props;
        return (
            <React.Fragment>
                <Navbar router={router} />
                {children}
            </React.Fragment>
        );
    }
}
